import React from 'react'

function Headeroptions ({Icon, title}) {
    return(
        <div className="header_options">
            {
                Icon && <Icon></Icon>
            }
            {
                Avatar && <Avatar name="{}"></Avatar>
            }
            <span>{title}</span>
        </div>
    )
}
  
export default Headeroptions;
